    "ad_copy": "WEAR BLACK, FIGHT BACK! CHALLENGE FOR OUR SUBSCRIBERS!October 22nd is one of the most important days for all of us. From 1996 onward people around the country have mobilized for a National Day of Protest to stop police brutality, repression and the criminalization of a generation. The powerful National Day of Protest will be brought in cities and towns all across the country. Let's make history together! It's time to stand up for our rights and our freedom! Our community has a challenge for you, guys. All you need to do is: wear black - take a picture of yourself during or right before/after this event send it to us. Simple as that! We will post all the pictures on our page, so that the whole African American community will know about you and your efforts. It's really important for us to know we're united. It's important for us to know we care about our future. Black Matters will appreciate your efforts too! Check the official website to find an event in your area: http://www.october22.org/ ",
