    "ad_id": 316.0,
    "ad_copy": "Why I March! #JusticeOrElse20 years ago. 20 years a million men, women and children gathered on the National Mall in Washington, DC answering the call from Minister Louis Farrakhan to come to the nation's capital and show our strength in numbers and unity and remind politicians that our voices would be heard. 20 years later, we return to call on our politicians to fix our broken criminal justice system once and for all. I march to fix a system that houses more black men in our prison system than there were black men enslaved in 1850. To fix a system that allows for local prosecutors to investigate their friends at the police department when there is an officer-involved shooting. To fix a system that has drug laws that disproportionately arrest black and brown people for using drugs when white people use at the same rate. To fix a system that has built a private industry off the backs of prisoners laboring for pennies. To fix a system that doesn't video record the actions of law enforcement at all times. To fix a system that criminalizes young women who are pimped and sexually trafficked before they even turn 18. To fix a system that does not collect any national data on incidents when police use excessive force or discharge their firearm. To fix a system that has incarcerated more people than any other nation in the world. To fix a system that has created a school to prison pipeline by harsher school discipline practices for young students of color. To fix a system of policing that targets communities of color by programs like \"Stop & Frisk\" or \"Broken Windows.\" This is why I march. This is why we all should march in order to build a better future for our kids. We should fight the institutional racism in the country. Like and share if you want to help the movement! ",
